import {Form, FloatingLabel,Container, Row, Col } from "react-bootstrap";

export default function Quran() {
  return (
    <Container>
      <Row>
        <Col></Col>
        <Col></Col>
      </Row>

      <FloatingLabel controlId="floatingPassword" label="Password">
        <Form.Control type="password" placeholder="Password" />
      </FloatingLabel>
    </Container>
  );
}
